import React, { Component } from 'react';
import Header2 from './Header2';
import '../css/mainPage.css';
import YounghoSearchResultContent from './YounghosearchResultContent';

class YounghoSearchResultPage extends Component {
    constructor(props) {
        super(props);
        this.state={
          userId:"alice"
        }
    }

    render() {
        const {userId} = this.state;
        // if(auth == false) {
        //     this.props.history.push("/login");
        // }

        return (
            <>
            <Header2 userId={userId}></Header2>
            <YounghoSearchResultContent></YounghoSearchResultContent>
            </>
        );
    }
}
export default YounghoSearchResultPage;
